import React from "react";

const Editor = () => {
  return (
    <div className={"flex grow bg-darker"}>
      <div className={"grow contents"} style={{marginLeft:"10px"}}>
      <img
              src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0="
              alt="Image1"
            />
      </div>
    </div>
  );
};

export default Editor;
